import React from 'react';

export default class Header extends React.Component {
  render() {
    return (
      <header>
        <div className="header_logo">
          <img alt="" src='../../Photo/logo.png' />
        </div>
        <nav>
    			<div class="topnav" id="myTopnav">
    				<a href="#">HOME</a>
    				<a href="#">ABOUT</a>
    				<a href="#">WORK</a>
    				<a href="#">PROCESS</a>
    				<a href="#">SERVICES</a>
    				<a href="#">TESTIMONIALS</a>
    				<a href="#">CONTACT</a>
    			</div>
    		</nav>
      </header>
    );
  }
}
